import React from 'react';


function List(props) {
  return (
  <>
  <div className="container">
   <h1 className="text-primary text-center">Signup users</h1>
   <h2>Email:{props.email}</h2>
   <h2>Password:{props.password}</h2>
 </div>

  </>
  );
}

export default List;
